import { Button, Nav, Navbar, Container, Row, Col, Form , ListGroup} from 'react-bootstrap';
import axios from 'axios'; 
import './loader.css'

function Details() {

  const [data, setData] = useState(''); 

  useEffect(() => {
    axios
      .get("http://127.0.0.1:8000/tagsdata")
      .then(response => setData(response.data));

  }, []);

    return ( <>
<style type="text/css">
    {`
    .btn-flat {
      background-color: purple;
      color: white;
    }
    .next{
      width: 50%;
      height: 40px;
    }
    .btn-xxl {
      padding: 1rem 1.5rem;
      font-size: 1.5rem;
    }
    `}
  </style>
  <Container  className="container-loader">
  <Row>
    <Col>
    <ListGroup>
  {
    data.map((newData)=>{
    return (
      <ListGroup.Item>{newData}</ListGroup.Item>
    )
  })}

</ListGroup>

<br></br>1 of 1<br></br>

<Button variant="flat" size="s" className="next"> Crawl More</Button></Col>
  </Row>
</Container>
</>
    );
}

export default Details;
